import React, {Component} from 'react';

import './Poem.css';


class Poem extends Component {
  render() {
    return (
      <div className="Poem col-6">
        {this.props.children}
      </div>
    );
  }
}


class Stanza extends Component {
  render() {
    return (
      <div className="Stanza">
        {this.props.children}
      </div>
    );
  }
}
